import React, { Component } from 'react';

class Home extends Component {
  render(){
    return(
      <div className="vh-100 bg-dark" Style="margin-top: -56px;">
        <div className="pt-5 pl-5">
          <h1>Yu Ohno's Portfolio</h1>
          <h2>Move Emotion</h2>
        </div>
      </div>
    )
  }
}
export default Home;
